pragma solidity ^0.4.18;

contract kycOracle {
  address oracleAddress;
  mapping (address => bool) kycClearances;
  event kycCleared(
    address indexed _clearedAddress,
    uint clearanceTimestamp
  );
  event kycAddressDeposited(
    address indexed _clearedAddress,
    uint depositValue,
    uint depositTimestamp
  );

  /*
  Je recommande la modification suivante :

  modifier kycOracle(address _oracleAddress) {
    oracleAddress = _oracleAddress;
    _;
  }

  */
  function kycOracle(address _oracleAddress) internal {
    oracleAddress = _oracleAddress;
  }

  modifier onlyKycCleared {
    require(kycClearances[msg.sender]);
    _;
  }
  function clearKyc(address _clearedAddress) public {
    require(msg.sender == oracleAddress);
    kycCleared(_clearedAddress, block.timestamp);
    kycClearances[_clearedAddress] = true;
  }
}

contract myTokenContract is kycOracle {
  address owner;
  // kycOracle n'est pas un modifier, je suis pas sûre que ça passera lors des tests
  // Il faut prévoir de modifier kycOracle en tant que "modifier" et là un tel appel sera bon
  // Sinon, initialiser l'adresse de l'oracle directement dans le constructeur myTokenContract()
  // En ajoutant la ligne suivante : oracleAddress =  0x18AEf80Dc69E9dAC454E2383A10FF37F969bc945; après owner = msg.sender;
  // On peut virer internal à mon avis car c'est un constructeur donc il est par défaut internal !!
  function myTokenContract() kycOracle(0x18AEf80Dc69E9dAC454E2383A10FF37F969bc945) internal {
    owner = msg.sender;
  }

  function() public onlyKycCleared payable {
    // Token distribution logic
    kycAddressDeposited(msg.sender, msg.value, block.timestamp);
  }
}
